s',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(460,'Schreber','Felis chaus','','','{\"1777\":1777}',0,8540,'','felis','',0,'Schreber','','','eutheria','carnivora','iucn','chaus','','','Jungle Cat','','felidae','true cats',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(461,'loche','Felis margarita','species&#95;photos/978eaed744fe4a3b9018c629d43c61fd.jpeg','*Felis margarita* is a felid commonly called the sand cat. It is 1 of 6 species in the genus *Felis*. One of the smallest of the wild cats, *Felis margarita* is adapted behaviorally and morphologically to live in desert environments. Prey includes rodents, birds, reptiles, and arthropods. This species has a wide, but disjunct distribution through northern Africa, the Arabian Peninsula, and southwest and central Asia. *F. margarita* occurs at low densities throughout its range and is listed as &ldquo;Near Threatened&rdquo; by the International Union for Conservation of Nature and Natural Resources due to habitat degradation and its low and potentially declining population. F. margarita is bred in zoos in North America and Europe.','{\"1777\":\"1858\"}',0,8541,'boreoeutheria','felis','philip kahn',0,'schreber','','','eutheria','carnivora','iucn','margarita','Philip Kahn','2017-06-15','sand cat','','felidae','true cats','F. Russell Cole, Don E. Wilson; *Felis margarita* (Carnivora: Felidae). *Mamm Species* 2015; 47 (924): 63-77. doi: 10.1093/mspecies/sev007','Nancy Vandermey','{&quot;Used by permission in publication&quot;:&quot;https://academic.oup.com/mspecies/article/47/924/63/2609388/Felis-margarita-Carnivora-Felidae?searchresult=1&quot;}','*Felis margarita* is one of the most specialized felines (heptner and sludskii 1992). The specialization for desert life is seen in the general structure of the skull, its facial and cranial proportions, the position of the orbits, and especially in the maximal development of the auditory apparatus. This species has an extremely broad, flat face with large, triangular ear pinnae set low on the head and lacking an apical tuft.\n\n## Description\n\n*Felis margarita* has a stocky build with a tail that is about one-half the head and body length (osborn and helmy 1980; sunquist and sunquist 2002). In addition to ears set low on the head, f. margarita has relatively short legs giving this cat a low profile, a possible advantage in its sparsely vegetated desert environment (osborn and helmy 1980; heptner and sludskii 1992). the claws on the forelimbs are short, sharply curved, and highly compressed laterally. the claws on the hind limbs are less compressed, weakly curved, more elongate, and relatively blunt (heptner and sludskii 1992). the retractile apparatus of the claws is poorly developed.\n\nthe crown of the head is pale sandy with poorly defined striations. the upper and lower lips and chin are white, and throat has a faint buffy wash (wilson and mittermeier 2009). a faint reddish line runs from the outside corner of each eye down across the cheek (roberts 1997; sunquist and sunquist 2002). the greenish yellow eyes are large and surrounded by a white ring. the rhinarium is black; the vibrissae are white and up to 8cm long (wilson and mittermeier 2009). the backs of the ears are tawny brown at the base and black at the tip and the ears are directed outward from the crown (roberts 1997). the inner ears are protected from blowing sand by a dense growth of long white hairs that spans the ear opening and continues along the ear margins to the apex (rosevear 1974).\n\nthe pelage is typically pale sandy to straw gray in color, with the dorsum slightly darker than the venter (sausman 1997b). the dorsum is usually without spots or stripes, but some individuals have a finely speckled pelage with black over the shoulders and silvery gray on the upper flanks (sunquist and sunquist 2002; wilson and mittermeier 2009). the venter is white. two to 3 prominent black bands ring the forelegs. the last one-third of the tail has a varying number of black rings and the tail ends with a black tip. the thighs are marked with black barring and the flanks with 7&ndash;8 indistinct reddish-brown vertical stripes, broken into spots with black in places (wilson and mittermeier 2009). the palms and soles of the feet are covered with dense, long (15&ndash;30mm), black fur that protects them from the hot desert substrate and assists in movement through loose sand (heptner and sludskii 1992). this characteristic makes the tracks of f. margarita indistinct and difficult to detect (abbadi 1993; sunquist and sunquist 2002).\n\nin addition to being restricted to sandy and rocky desert habitat, f. margarita is distinguished from other potentially co-occurring small felids (f. chaus&mdash;jungle cat and f. silvestris&mdash;wildcat) by its pale pelage; prominent facial and foreleg markings; large, broad, and low set ears that lack tufts; rounded cranium and shortened rostrum; and relatively broad paws that are covered with hair (osborn and helmy 1980; harrison and bates 1991; serra et al. 2007).\n\nthe different races become gradually larger from west to east across the species range. although there is considerable overlap in osteological measurements, f. m. margarita from north africa has a relatively narrow skull, relatively small bullae, and small carnassials in comparison to f. m. harrisoni from the arabian peninsula (hemmer et al. 1976; goodman and helmy 1986; harrison and bates 1991). f. m. margarita possesses brighter pelage with more distinct markings, buffy-white paws, and 2&ndash;6 tail rings compared to f. m. harrisoni with paler dorsal pelage, very white paws, and 5&ndash;7 rings on the tail.\n\n## morphology\n\nthe felis margarita adult has soft, dense fur, which protects it from the cold nighttime desert temperatures (roberts 1997). there is no sexual dimorphism in pelage coloration, but there are marked age-related color differences. the pelage color of newborn f. margarita is pale yellow or chestnut-gray speckled with small brown, indistinct spots on the back and especially the flanks (heptner and sludskii 1992). a dark but indistinct band runs along the spine. the head has several dark longitudinal stripes, which widen at the neck. the tail has a black tip with 2 rings anterior to it and 3 or 4 dark spots along the dorsal surface. after the 1st molt, young grow pelage that is similar to adults, but darker on the dorsum along the spine and with small dark spots behind the shoulders. banding on the legs and markings on the tail are more distinct than for newborns (heptner and sludskii 1992).\n\nthe f. margarita skull most closely resembles that of pallas&rsquo;s cat (otocolobus manul&mdash;sunquist and sunquist 2002; fig. 2). the cranium is broad, the rostrum short, and the zygomatic arches wide. the anterior ends of zygomatic processes gradually taper in. the eye sockets are large, more spherical, and more forward directed than in f. silvestris. the tympanic bullae are more inflated than in other old world cats. the skulls of both sexes are similarly proportioned, but the female skull is about 85&#37; of the size of the male skull.\n\nfelis margarita pelage is soft and dense with abundant soft wooly underfur (heptner and sludskii 1992). the winter pelage of f. margarita is long and dense. the mean length of guard hairs on the dorsum of f. margarita in the winter pelage was 55.3mm and their mean thickness was 84.2 &micro;m. heptner and sludskii (1992) investigated the length and width of pelage hair by dividing the pelage into 4 layers. they reported hair length (mm) and width (&micro;m) decreased beginning at the pelage surface and ending at the underfur for each layer, respectively (49.0 and 100.5; 47.7 and 87.0; 43.9 and 74.0; and 38.4 and 32.0). the underfur was 30.0mm long and 17.0 &micro;m wide. the mean density of the dorsum fur on 1 specimen was 4,532 hairs/cm2 (heptner and sludskii 1992). the summer pelage lies closer to the skin and is shorter, sparser, and coarser in comparison to the winter pelage\n\n## distribution\n\nfelis margarita is found in sand and stony desert environments in a wide but disjunct distribution through the deserts of northern africa, the arabian peninsula, and southwest and central asia (nowell and jackson 1996; sunquist and sunquist 2002; wozencraft 2005; wilson and mittermeier 2009; mallon et al. 2011; fig. 3). the lack of f. margarita records in apparently suitable areas may reflect inadequate study rather than species absence (hemmer et al. 1976; nowell and jackson 1996). consequently, distribution maps must be interpreted with caution.','iucn','Adult, showing face','','',NULL,NULL,NULL),(462,'Burchell','Felis nigripes','','','{\"1777\":1824}',0,8542,'','felis','',0,'Schreber','','','eutheria','carnivora','iucn','nigripes','','','Black-footed Cat','','felidae','true cats',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(463,'Schreber','Felis silvestris','','','{\"1777\":1777}',0,8543,'','felis','',0,'Schreber','','','eutheria','carnivora','iucn','silvestris','','','Wild Cat','','felidae','true cats',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(464,'(&Eacute;. Geoffroy Saint-Hilaire, 1803)','Herpailurus yagouaroundi','','','',0,9948,'','herpailurus','',0,'','','','eutheria','carnivora','iucn','yagouaroundi','','','Jaguarundi','','felidae','true cats',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(465,'','Homotherium serum','','','',0,300000016,'','homotherium','',0,'','','','eutheria','carnivora','newspext','serum','','','','','felidae','true cats',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(466,'(Molina, 1782)','Leopardus colocolo','','','',0,15309,'','leopardus','',0,'','','','eutheria','carnivora','iucn','colocolo','','','Pampas Cat','','felidae','true cats',NULL,NULL,NULL,NULL,'iucn',NULL,NULL,NULL,NULL,NULL,NULL),(467,'(d&#39;Orbigny &amp;amp; Gervais, 1844)','Leopardus geoffroyi','','','',0,15310,'','leopardus','',0,'','','',